import React from "react";
import Match from "./Match";
import Unmatch from "./Unmatch";

const SlotM = (props) =>{
    // let x = ":)";
    // let y = ":)";
    // let z = ":)";

    // let x= props.x;
    // let y= props.y;
    // let z= props.z;
    let {x,y,z}=props;
    
    if((x===y) && (y===z)){
        return(
            <>
            <div className="slot_inner">
            <h1>{x} {y} {z}</h1>
            <h1>this is matching</h1>
            </div>
            <hr/>
            </>
        );
    }
    else{
        return(
            <>
            <div className="slot_inner">
            <h1>{x} {y} {z}</h1>
            <h1 style={{color:"red"}}>this is not matching</h1>
            </div>
            </>
        );
    }
}
export default SlotM;
